import React from 'react';
import {Button, Container, Stack} from 'react-bootstrap';


function Home(){
    return (
        <>
        <Container className='justify-content-start mt-5'>
            <h1 className="title" style={{fontSize: 60}}>Your delivered expectations at just one click away</h1>
            <p className="subtitle w-50 pt-3" style={{fontSize: 20, }}>Calculate your services, whether you need a new website or an update, 
            and we will deliver the product based on your needs and expectations.</p>

            <Stack direction="horizontal" gap={3} className="call-to-action">
            <Button href="#pricecalculator">Get Started!</Button>{' '}
            <p className="mt-3">or get in touch with us</p>
            </Stack>
            
        </Container>
        </>
    );
}

export default Home
